    while(t>0)
    {
        k=0;
        scanf("%u%u",&x,&y);
        for(num = 1;num<(x-y);num++)
        {
             count = 0;

             for(i=2;i<=num/2;i++)
            {
                 if(num%i==0)
                 {
                     count++;
                     break;
                 }
            }

             if(count==0 && num!= 1&&(x-y)%num==0)
             {
                 k=1;
                 printf("YES\n");
                 break;
             }
             if(k==1)
                break;
        }
        if(k==0)
            printf("NO\n");
        t--;
    }



   return 0;
}

