['#include<stdio.h>

void merge(int arr[], int l, int m, int r) 
{ 
    int i, j, k; 
    int n1 = m - l + 1; 
    int n2 =  r - m; 
    int L[n1], R[n2]; 
    for (i = 0; i < n1; i++) 
        L[i] = arr[l + i]; 
    for (j = 0; j < n2; j++) 
        R[j] = arr[m + 1+ j]; 
    i = 0; 
    j = 0; 
    k = l;
    while (i < n1 && j < n2) 
    { 
        if (L[i] <= R[j]) 
        { 
            arr[k] = L[i]; 
            i++; 
        } 
        else
        { 
            arr[k] = R[j]; 
            j++; 
        } 
        k++; 
    } 
    while (i < n1) 
    { 
        arr[k] = L[i]; 
        i++; 
        k++; 
    } 
    while (j < n2) 
    { 
        arr[k] = R[j]; 
        j++; 
        k++; 
    } 
} 
  
void sort(int arr[],int l, int r) 
{ 
    if (l < r) 
    { 
        int m = l+(r-l)/2; 
        sort(arr, l, m); 
        sort(arr, m+1, r); 
  
        merge(arr, l, m, r); 
    } 
} 

int main()
{
    int q;
    scanf("%d",&q);
    while(q--)
    {
        int n,c;
        scanf("%d %d",&n,&c);
        int arr[n];
        for(int i=0;i<n;i++)
        scanf("%d",&arr[i]);
        sort(arr,0,n-1);
        int count=0;
        for(int j=n-1;j>=0;)
        {
            int temp=arr[j];
            while(arr[j-1]==temp&&j>0){
                j--;
            }
            arr[j]-=count*c;
            if(arr[j]>0)
            count++;
            j--;
        }
        printf("%d\n",count);
    }
}

