['#include <stdio.h>
#include <stdlib.h>

void mergeSort(int *array, int begin, int end);
void merge(int *array, int begin, int middle, int end);


int coordinate[100000];

int main() {
	int N;
	scanf("%d", &N);

	while (N--) {
		int n, r;
		scanf("%d %d", &n, &r);

		int i;
		for (i = 0; i < n; i++) {
			scanf("%d", &coordinate[i]);
		}

		mergeSort(coordinate, 0, n-1);
		int counter = 0, count = 1;
		
		while (n > 1) {
			for (i = n-1; i >= 0; i--) {
				if (coordinate[i] != coordinate[i-1]) {
					break;
				}
			}
			n = i + 1;

			if (coordinate[n-2] <= count * r) {
				break;
			}

			count++;
			n--;
		}

		counter = count;
		printf("%d\n", counter);
	}

	return 0;
}

void mergeSort(int *array, int begin, int end) {
	if (begin >= end) {
		return;
	}
	if (begin < end) {
		int middle = (begin + (end - begin)/2);
		if (middle > begin) {
			mergeSort(array, begin, middle);
		}
		if (end > middle +1) {
			mergeSort(array, middle+1, end);
		}
		merge(array, begin, middle, end);
	}
}

void merge(int *array, int begin, int middle, int end) {
	int n1 = middle - begin + 1;
	int n2 = end - middle;

	int *subArray1 = (int*)malloc((n1) * sizeof(int));
	int *subArray2 = (int*)malloc((n2) * sizeof(int));

	int i;
	for (i = 0; i < n1; i++) {
		subArray1[i] = array[begin  + i]; 
	} 
	for (i = 0; i < n2; i++) {
		subArray2[i] = array[middle + i + 1];
	}
 
	int j, k;
	for (i = 0, j = 0, k = begin; i < n1 && j < n2; k++) {
		if (subArray1[i] <= subArray2[j]) {
			array[k] = subArray1[i];
			i++;
		}
		else {
			array[k] = subArray2[j];
			j++;
		}
	}
	while (i < n1) {
		array[k++] = subArray1[i++];
	}
	while (j < n2) {
		array[k++] = subArray2[j++];
	
	}

	free(subArray1);
	free(subArray2);
}']

