['import java.util.Arrays;
import java.util.Scanner;

public class Kill {

    static int killem(int[] cord, int r) {
        Arrays.sort(cord);
        int numofshots = 0;
        int big = cord[cord.length - 1];
        for (int j = 0; j < cord.length; j++) {

            if (cord[j] > 0) {
                for (int i = cord.length - 1; i > 0; i--) {
                    if (cord[i] == big) {
                        cord[i] = -1;
                    } else {
                        cord[i] = cord[i] - r;
                    }
                }
                numofshots++;
            }

        }
        return numofshots;
    }
public static void main(String[] args) {
    Scanner scanner = new Scanner(System.in);
    int testCse = scanner.nextInt();
    for (int j = 0; j < testCse; j++) {
        int[] ar = new int[scanner.nextInt()];
        int r = scanner.nextInt();

        for (int i = 0; i < ar.length; i++) {
            ar[i] = scanner.nextInt();

        }
        System.out.println(killem(ar, r));


    }
}
    }
