['#include <stdio.h>
void merge(int arr[], int l, int r) {
	int m=(l+r)/2;
	int a=l, b=m+1, k=0, temp[r-l+1];
	while (a<=m&&b<=r) {
		if (arr[a]>=arr[b]) temp[k++]=arr[b++];
		else temp[k++]=arr[a++];
	}
	while (a<=m) temp[k++]=arr[a++];
	while (b<=r) temp[k++]=arr[b++];
	for (int i=0;i<k;i++) arr[i+l]=temp[i];
}
void mergeSort(int arr[], int l, int r) {
	if (l==r) return;
	int m=(l+r)/2;
	mergeSort(arr, l, m);
	mergeSort(arr, m+1, r);
	merge(arr, l, r);
}
int main() {
	int t;
	scanf("%d", &t);
	while (t--) {
		int n, r;
		scanf("%d %d", &n, &r);
		int arr[n];
		for (int i=0;i<n;i++) scanf("%d", &arr[i]);
		mergeSort(arr, 0, n-1);
		int totrad=0, ans=0;
		for (int i=n-1;i>=0;i--) {
			if (i==n-1) {
				totrad+=r;
				ans++;
			}
			else {
				if (arr[i]!=arr[i+1]) {
					if (arr[i]-totrad>0) ans++;
					totrad+=r;
				} 
			}
		}
		printf("%d\n", ans);
	}
}
']

